    let history = useHistory();
    
    
    return (
        <div>
            <h1>PORTAFOLIO</h1>
            <Button onClick={() => history.push('/home') }>dale click para volver  ala pagina </Button>
            <div>
              <img className="perfilfoto"
              src='https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/evolucion-leonardo-dicaprio-principal-1573497722.jpg?crop=0.671xw:1.00xh;0.117xw,0&resize=640:*'/>
              <h5> Juan Pablo Rojas</h5>
              <p> si esta viendo este parrafo,posiblemente mi cpmputador nno me ha dejado trabajar, y tome como reurso colocar este texto, ya que no me compila muchas de las cosas que realizo, y no estan mal realizadas por que no me arroja mingun error. son aproximadamente las 9:42 de la ma√±ana, de igual manera voy a seguir intrnntando y a hcer todo lo que pueda </p>

           </div>
        </div>
    )
}

export default Portafolio
